    {tittle: "Tittle 3", color: "blue"},
    {tittle: "Tittle 4", color: "yellow"},
    {tittle: "Tittle 5", color: "green"},
];

export function Swipper() {


    useEffect(() => {}, []);

    return (
        <main>
            {data.map((item, index) => (
                <section
                style={{ "background-color": `${item.color}` }}
